            if (FormLinkInformation.TryFactory(obj.ArtObject, out var ArtObjectInfo))
            {
                yield return ArtObjectInfo;
            }
            if (FormLinkInformation.TryFactory(obj.BodyPartData, out var BodyPartDataInfo))
